// src/components/LoginForm.js
import React from 'react';
import './Register.css'; 

function RegisterForm() {
    return(
        <div className="login">
            <h2>Registro de usuario</h2>
            <form id="login-form">
                
                <button type="submit" className="button float" id="button-submit">
                    Log in
                </button>
            </form>
        </div>
    );
}

export default RegisterForm;
